import React from 'react';
import { Box, Typography, TextField, Button, Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';
import { motion } from 'framer-motion';

const ContactContainer = styled(Box)(({ theme }) => ({
  padding: theme.spacing(8, 0),
  background: `url('/rustic-bg.png') repeat`,
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    background: 'rgba(255, 248, 220, 0.95)',
  },
}));

const ContactForm = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  background: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: -10,
    left: -10,
    right: -10,
    bottom: -10,
    border: '2px solid #DEB887',
    borderRadius: '12px',
    zIndex: -1,
  },
}));

const ContactTitle = styled(Typography)(({ theme }) => ({
  fontFamily: '"Caveat", cursive',
  fontSize: '2.5rem',
  color: theme.palette.primary.main,
  textAlign: 'center',
  marginBottom: theme.spacing(4),
}));

const StyledTextField = styled(TextField)(({ theme }) => ({
  marginBottom: theme.spacing(3),
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: '#DEB887',
    },
    '&:hover fieldset': {
      borderColor: theme.palette.primary.main,
    },
  },
}));

const SubmitButton = styled(Button)(({ theme }) => ({
  fontFamily: '"Caveat", cursive',
  fontSize: '1.2rem',
  padding: theme.spacing(1, 4),
  background: theme.palette.primary.main,
  color: '#fff',
  '&:hover': {
    background: theme.palette.primary.dark,
  },
}));

const ContactInfo = styled(Box)(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  marginBottom: theme.spacing(2),
  '& img': {
    width: '24px',
    height: '24px',
    marginRight: theme.spacing(2),
    filter: 'invert(31%) sepia(95%) saturate(1194%) hue-rotate(358deg) brightness(87%) contrast(89%)',
  },
}));

const Contact: React.FC = () => {
  return (
    <ContactContainer>
      <Box sx={{ position: 'relative', zIndex: 1 }}>
        <Grid container spacing={4} justifyContent="center">
          <Grid item xs={12} md={6}>
            <motion.div
              initial={{ opacity: 0, x: -20 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <ContactForm>
                <ContactTitle variant="h2">Get in Touch</ContactTitle>
                <form>
                  <StyledTextField
                    fullWidth
                    label="Name"
                    variant="outlined"
                  />
                  <StyledTextField
                    fullWidth
                    label="Email"
                    variant="outlined"
                    type="email"
                  />
                  <StyledTextField
                    fullWidth
                    label="Message"
                    variant="outlined"
                    multiline
                    rows={4}
                  />
                  <Box sx={{ textAlign: 'center' }}>
                    <SubmitButton variant="contained" type="submit">
                      Send Message
                    </SubmitButton>
                  </Box>
                </form>
              </ContactForm>
            </motion.div>
          </Grid>
          <Grid item xs={12} md={4}>
            <motion.div
              initial={{ opacity: 0, x: 20 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <Box sx={{ mt: 4 }}>
                <ContactInfo>
                  <img src="/images/location-arrow-svgrepo-com.svg" alt="Location" />
                  <Typography>TBA</Typography>
                </ContactInfo>
                <ContactInfo>
                  <img src="/images/phone-svgrepo-com.svg" alt="Phone" />
                  <Typography>(555) 123-4567</Typography>
                </ContactInfo>
                <ContactInfo>
                  <img src="/images/email-part-2-svgrepo-com.svg" alt="Email" />
                  <Typography>sweetsyouknead@gmail.com</Typography>
                </ContactInfo>
                <ContactInfo>
                  <img src="/images/clock-0900-svgrepo-com.svg" alt="Hours" />
                  <Typography>Mon-Sat: 7am - 7pm</Typography>
                </ContactInfo>
              </Box>
            </motion.div>
          </Grid>
        </Grid>
      </Box>
    </ContactContainer>
  );
};

export default Contact;
